import TransactionItem from './TransactionItem'

const TransactionHistory = ({ items }) => (
  <ul>
    {items.map((item) => (
      <li key={item.id}>
        <TransactionItem
          type={item.type}
          amount={item.amount}
          currency={item.currency}
        />
      </li>
    ))}
  </ul>
)

export default TransactionHistory
